import React, { useState, useEffect } from "react";
import FaultCardUser from "@/components/FaultCardUser/FaultCardUser";
import FaultCardUserView from "@/components/FaultCardUserView/FaultCardUserView";

interface CardData {
  title: string;
  address: string;
  arrowCount: number;
  commentCount: number;
  viewCount: number;
  ticketNumber: string;
  description: string;
  image: string;
  createdBy: string;
}

const FaultCardContainer: React.FC = () => {
  const [startIndex, setStartIndex] = useState(0); // Index to track the starting point of displayed items
  const itemsPerPage = 7; // Number of items to display per page
  const [showModal, setShowModal] = useState(false);
  const [selectedCard, setSelectedCard] = useState<CardData | null>(null);
  const [dynamicCardData, setDynamicCardData] = useState<CardData[]>([]);

  // Placeholder card data for development, this will be replaced by an array of json objects of tickets from the database (see below)
  useEffect(() => {
    const cardData: CardData[] = [
      {
        title: "Pothole",
        address: "271 Berry Street, Garsfontein",
        arrowCount: 10800,
        commentCount: 4900,
        viewCount: 873,
        ticketNumber: "SA1029",
        description:
          "There is a massive leakage... its flooding the streets and gardens.",
        image:
          "data:image/jpeg;base64,",
        createdBy: "Kyle Marshall",
      },
      {
        title: "Power Outage",
        address: "55 Elm Avenue, Lyttelton",
        arrowCount: 8500,
        commentCount: 3200,
        viewCount: 1200,
        ticketNumber: "PA1030",
        description: "There is a major power outage affecting the entire area.",
        image:
          "data:image/jpeg;base64,",
        createdBy: "Jane Doe",
      },
      {
        title: "Leaking Fire Hydrant",
        address: "123 Oak Lane, Brooklyn",
        arrowCount: 12300,
        commentCount: 6700,
        viewCount: 2300,
        ticketNumber: "LF1031",
        description: "The fire hydrant is leaking and causing water wastage.",
        image:
          "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTnGIPsFzQ0Cjm-9i6X2bSjbFBG8dm2MgJkBg&s",
        createdBy: "John Smith",
      },
      {
        title: "Overgrown Vegetation",
        address: "789 Maple Road, Lynnwood",
        arrowCount: 9100,
        commentCount: 5400,
        viewCount: 1800,
        ticketNumber: "GL1032",
        description: "The sidewalks are full of grass.",
        image:
          "https://cdn.prod.website-files.com/65d2a48b86ea9062ba3686eb/65d6c5152602be8db56ad73d_6513ab586d593138f1eae2a2_overgrown.png",
        createdBy: "Alice Johnson",
      },
      {
        title: "Water Main Break",
        address: "101 Pine Street, Hatfield",
        arrowCount: 13000,
        commentCount: 5000,
        viewCount: 2200,
        ticketNumber: "WM1033",
        description:
          "A water main break is causing significant flooding in the area.",
        image:
          "data:image/jpeg;base64,",
        createdBy: "Chris Evans",
      },
      {
        title: "Sinkhole",
        address: "89 Oakwood Drive, Groenkloof",
        arrowCount: 15000,
        commentCount: 7200,
        viewCount: 3000,
        ticketNumber: "SH1034",
        description:
          "A large sinkhole has appeared in the middle of the street.",
        image:
          "data:image/jpeg;base64,",
        createdBy: "Natasha Romanoff",
      },
      {
        title: "Traffic Light Malfunction",
        address: "34 Elm Street, Waterkloof",
        arrowCount: 12000,
        commentCount: 6500,
        viewCount: 2700,
        ticketNumber: "TL1035",
        description:
          "The traffic lights at the intersection are malfunctioning.",
        image:
          "data:image/jpeg;base64,",
        createdBy: "Steve Rogers",
      },
      // Add more placeholder cards here if needed
    ];
    setDynamicCardData(cardData);
  }, []);

  const handleCardClick = (cardData: CardData) => {
    setSelectedCard(cardData);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setSelectedCard(null);
  };

  const showNextItems = () => {
    setStartIndex((prevIndex) => prevIndex + itemsPerPage);
  };

  const showPreviousItems = () => {
    setStartIndex((prevIndex) => prevIndex - itemsPerPage);
  };

  const visibleItems = dynamicCardData
    .slice(startIndex, startIndex + itemsPerPage)
    .map((item, index) => (
      <FaultCardUser
        key={startIndex + index}
        title={item.title}
        address={item.address}
        arrowCount={item.arrowCount}
        commentCount={item.commentCount}
        viewCount={item.viewCount}
        ticketNumber={item.ticketNumber}
        description={item.description}
        image={item.image}
        createdBy={item.createdBy}
        onClick={() => handleCardClick(item)}
      />
    ));

  return (
    <div className="flex flex-col items-center w-full rounded-lg shadow-md overflow-hidden m-2">
      <div
        className="w-full overflow-x-auto custom-scrollbar"
        style={{
          paddingLeft: "16px",
          paddingRight: "16px",
          scrollbarWidth: "thin",
          scrollbarColor: "rgba(255, 255, 255, 0.5) transparent",
        }}
      >
        <style jsx>{`
          ::-webkit-scrollbar {
            height: 6px;
          }
          ::-webkit-scrollbar-thumb {
            background: rgba(255, 255, 255, 0.5);
            border-radius: 3px;
          }
          ::-webkit-scrollbar-track {
            background: transparent;
          }
        `}</style>
        <div className="flex justify-start">
          <div className="flex mb-8 text-center flex-nowrap">
            {visibleItems}
          </div>
        </div>
      </div>
      {showModal && selectedCard && (
        <FaultCardUserView
          show={showModal}
          onClose={handleCloseModal}
          title={selectedCard.title}
          address={selectedCard.address}
          arrowCount={selectedCard.arrowCount}
          commentCount={selectedCard.commentCount}
          viewCount={selectedCard.viewCount}
          ticketNumber={selectedCard.ticketNumber}
          description={selectedCard.description}
          image={selectedCard.image}
          createdBy={selectedCard.createdBy}
        />
      )}
    </div>
  );
};

export default FaultCardContainer;
